package views

import (
	"bytes"
	"encoding/base64"

	"image/jpeg"

	"github.com/rivo/tview"
)

const (
	anchor = ``
)

func HomeMain() tview.Primitive {
	b, _ := base64.StdEncoding.DecodeString(anchor)
	photo, _ := jpeg.Decode(bytes.NewReader(b))
	image := tview.NewImage().SetImage(photo)
	return image
}

func HomeMenu() tview.Primitive {
	return tview.NewTextView().SetText("HomeMenu")
}

func HomeSidebar() tview.Primitive {
	return tview.NewTextView().SetText("HomeSidebar")
}